import React, { useState } from 'react';
import { Navbar, Nav, NavDropdown, Container, Row, Col } from 'react-bootstrap';
import './App.css';

function CustomNavbar() {
  const [showDropdown, setShowDropdown] = useState({});

  const handleMouseEnter = (dropdown) => {
    setShowDropdown({ ...showDropdown, [dropdown]: true });
  };

  const handleMouseLeave = (dropdown) => {
    setShowDropdown({ ...showDropdown, [dropdown]: false });
  };

  return (
    <Navbar expand="lg" bg="light" variant="light">
      <Container>
        <Navbar.Brand href="#home">QUEST | Nawabshah</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            
            {/* Academics Dropdown */}
            <NavDropdown 
              title="Academics" 
              id="nav-dropdown-academics"
              show={showDropdown.academics}
              onMouseEnter={() => handleMouseEnter('academics')}
              onMouseLeave={() => handleMouseLeave('academics')}>
              <NavDropdown.Item href="#programs">Programs</NavDropdown.Item>
              <NavDropdown title="Undergraduate" id="nav-dropdown-undergraduate">
                <NavDropdown.Item href="#ug-course-1">Course 1</NavDropdown.Item>
                <NavDropdown.Item href="#ug-course-2">Course 2</NavDropdown.Item>
              </NavDropdown>
              <NavDropdown title="Postgraduate" id="nav-dropdown-postgraduate">
                
              </NavDropdown>
            </NavDropdown>

            {/* Faculties Dropdown */}
            <NavDropdown 
              title="Faculties" 
              id="nav-dropdown-faculties"
              show={showDropdown.faculties}
              onMouseEnter={() => handleMouseEnter('faculties')}
              onMouseLeave={() => handleMouseLeave('faculties')}>
              <NavDropdown.Item href="#FEECE">FEECE</NavDropdown.Item>
              <NavDropdown title="Compuuter Systems Engineering" id="nav-dropdown-undergraduate">
                
              </NavDropdown>
              <NavDropdown title="Electrical Engineering" id="nav-dropdown-postgraduate">
                
              </NavDropdown>
            </NavDropdown>

            {/* Add more NavDropdowns as needed */}
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default CustomNavbar;
